import TeamCard from './TeamCard'


export default class Team extends Component {
    render() {
        return (
            <div className="team_bg">
              <h1>Team</h1>  
              <div className="team_cont">
                <TeamCard />
                <TeamCard />
                <TeamCard />
                <TeamCard />
                <TeamCard />
              </div>
            </div>
        )
    }
}
